import React, { Component } from 'react'
import { Layout, Card } from 'antd';
export default class login extends Component {
    render() {
        return (
            <Layout 
            style={{ height: '100vh' }}>
                <Card style={{ width: 300 }}>
                    <p>Card content</p>
                    <p>Card content</p>
                    <p>Card content</p>
                </Card>
            </Layout>
        )
    }
}
